import React from 'react';

const SlideImage = ({ url }) => {

    const styles = {
      backgroundImage: `url('./images/slider_1.jpg')`,
      backgroundSize: 'cover',
      backgroundPosition: 'center'
    };

    return (
      <div className="image-slide" style={styles}></div>
    );
  };

  export default SlideImage;
